import React from 'react';
import TYPESOFTHERAPY from './services/TypesOfTherapyJSON';
import Card from './Card'

const CardList = (props) => {
    const typesoftherapy = TYPESOFTHERAPY;


        return ( 
            <ul className="card-list__container">

            {
            typesoftherapy.map((cardObject) =>
            <li className="card-object"
                key={cardObject.id}>
            <Card
                     icon={cardObject.icon}
                     title={cardObject.title}
                     text={cardObject.text.main}
                     how={cardObject.text.details.how}
                     price={cardObject.price}
                     slogan={cardObject.slogan}
             />
             </li>
            )}
         </ul>

        );

}

export default CardList;
